namespace fs = boost::filesystem;

fs::path get_tmp_dir() {
    char* tmp_path_str = std::getenv("ALLDATA_PATH");
    BOOST_CHECK (tmp_path_str!=nullptr);
    fs::path tmp_dir = tmp_path_str;
    fs::path subdir = "tmp";
    tmp_dir /= subdir;
    fs::create_directories(tmp_dir);
    return tmp_dir;
}

std::unordered_map<int, std::forward_list<int>> get_fw(std::vector<int> v) {
    std::unordered_map<int, std::forward_list<int>> r;
    for (int i = 0; i < v.size()/2; i++) {
        r[v[i]].push_front(v[i+1]);
    }
    return r;
}

void create_graph(long nodes, std::vector<long> edgelist, std::vector<long> adversaries, double w = 1.0) {
    auto tmp_dir = get_tmp_dir();

    ofstream attf;
    attf.open((tmp_dir / "attributes.txt").c_str());
    attf << "n=" << nodes << "\nm=" << (long)(edgelist.size()/2) << "\ngraph_id=110";
    attf.close();

    ofstream f;
    f.open((tmp_dir / "graph.csv").c_str());
    for (long i = 0; i < edgelist.size()/2; i++) {
        f << edgelist[2*i] << " " << edgelist[2*i+1] << " " << w << "\n";
    }
    f.close();

    ofstream logf((tmp_dir / "adversary.json").c_str());
    json j;
    j["Blocked nodes"] = adversaries;
    logf << j;
}

double load_result(std::string key) {
    auto tmp_dir = get_tmp_dir();
    ifstream logf((tmp_dir / "result.json").c_str());
    json j;
    logf >> j;
    logf.close();
    return j.at(key);
}

BOOST_AUTO_TEST_CASE(testSestimationByDSF) {
    std::vector<long> edgelist({1,0, 2,1, 4,1, 4,2, 2,3, 3,4});
    std::vector<long> adversary({3,4,1,0,2});
    create_graph(5, edgelist, adversary);

    auto tmp_dir = get_tmp_dir();
    Rob rob(Rob::DFS_MAX_TREE, tmp_dir.c_str(), (tmp_dir / "adversary.json").c_str());
    BOOST_TEST(rob.g.get_graph_id() == "110");
    rob.run(1);
    rob.save_log((tmp_dir / "result.json").c_str());

    BOOST_TEST(load_result("rob") == 14./5); // (5 + 4 + 3 + 1 + 1) / 5, start with no nodes blocked

}

BOOST_AUTO_TEST_CASE(testMyDagCreatingNodesSimpleTriangle) {
    MyDAG mydag;
    std::unordered_map<int, std::forward_list<int>> out_graph_edges;
    out_graph_edges[0] = std::forward_list<int>(1, 1); // length, value
    out_graph_edges[1] = std::forward_list<int>(1, 2);
    out_graph_edges[2] = std::forward_list<int>(1, 0);
    mydag.set_out_graph_edges_and_active_nodes(&out_graph_edges);
    BOOST_TEST(mydag.get_active_node_size() == 3);
    std::unordered_set<int> node_set({0, 1, 2});
    mydag.calculate_scc(&node_set);
    BOOST_TEST(mydag.getSccSize(0) == 3);
    BOOST_TEST(mydag.getSccSize(1) == 3);
    BOOST_TEST(mydag.getSccSize(2) == 3);

    mydag.removeNode(1);
    BOOST_TEST(mydag.get_active_node_size() == 2);
    BOOST_TEST(mydag.getSccSize(0) == 1);
    BOOST_TEST(mydag.getSccSize(2) == 1);

}

BOOST_AUTO_TEST_CASE(testMyDagCyclic) {
    MyDAG mydag;
    std::vector<int> edges({1,0, 0,4, 2,1, 2,4, 2,3, 3,2, 3,4, 4,3, 4,5, 5,6, 6,5, 6,4, 0,8, 8,9, 9,8, 10,11,11,12,10,13,13,12,12,10});
    auto out_graph_edges = get_fw(edges);
    mydag.set_out_graph_edges_and_active_nodes(&out_graph_edges);
    mydag.build();
    BOOST_TEST(!mydag.isDagCyclic());
}

BOOST_AUTO_TEST_CASE(testMyDagSimpleEdges) {
    MyDAG mydag;
    std::unordered_map<int, std::forward_list<int>> out_graph_edges;
    out_graph_edges[0] = std::forward_list<int>(1, 1); // length, value
    mydag.set_out_graph_edges_and_active_nodes(&out_graph_edges);
    std::unordered_set<int> node_set({0, 1});
    mydag.calculate_scc(&node_set);
    BOOST_TEST(mydag.getSccSize(0) == 1);
    BOOST_TEST(mydag.getSccSize(1) == 1);
    BOOST_TEST(mydag.vertices.size() == 2);
    int scc_id = mydag.getSccId(0);
    mydag.build_scc_edges(&node_set);
    BOOST_TEST(mydag.vertices[scc_id].outDegree() == 1);
}

